  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`在这个场景中，Rancher 不提供 Kubernetes，因为它是由供应商安装的，例如 Google Kubernetes Engine，Amazon Elastic Container Service for Kubernetes 或 Azure Kubernetes 服务。`}</p>
    <p>{`如果您使用 Kubernetes 提供商(例如：谷歌 GKE)提供的集群，Rancher 将与相应的云 API 对接。Rancher 允许您通过 Rancher UI 在托管的集群中创建和管理基于角色的访问控制。`}</p>
    <p>{`在这种情况下，Rancher 使用云供应商的 API 向云供应商发送请求来创建或者更新托管集群。然后，提供商为您创建/更新并托管集群。当集群创建成功后，您可以像管理其他本地集群或云上集群一样，通过 Rancher UI 管理全部的集群。`}</p>
    <p>{`Rancher 目前支持以下 Kubernetes 供应商：`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`Kubernetes 提供商`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`可用于`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "https://cloud.google.com/kubernetes-engine/"
            }}>{`谷歌 GKE (Google Kubernetes Engine)`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`v2.0.0`}</td>
        </tr>
        <tr parentName="tbody">
