            "align": null
          }}><a parentName="td" {...{
              "href": "https://aws.amazon.com/eks/"
            }}>{`亚马逊 EKS (Amazon Elastic Container Service for Kubernetes)`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`v2.0.0`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "https://azure.microsoft.com/en-us/services/kubernetes-service/"
            }}>{`微软 AKS (Azure Kubernetes Service)`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`v2.0.0`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "https://www.alibabacloud.com/product/kubernetes"
            }}>{`阿里云 ACK (Alibaba Cloud Container Service for Kubernetes)`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`v2.2.0`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "https://intl.cloud.tencent.com/product/tke"
            }}>{`腾讯 TKE (Tencent Kubernetes Engine)`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`v2.2.0`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><a parentName="td" {...{
              "href": "https://www.huaweicloud.com/product/cce.html"
            }}>{`华为 CCE (Huawei Cloud Container Engine)`}</a></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`v2.2.0`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "托管-kubernetes-提供商的身份验证"
    }}>{`托管 Kubernetes 提供商的身份验证`}</h2>
    <p>{`当使用 Rancher 创建由提供商托管的集群时，会提示您输入身份验证信息。Rancher 将用这个信息来访问云厂商的 API，详情请参阅以下文档：`}</p>
    <ul>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/docs/rancher2/cluster-provisioning/hosted-kubernetes-clusters/gke/_index"
        }}>{`创建 GKE 集群`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/docs/rancher2/cluster-provisioning/hosted-kubernetes-clusters/eks/_index"
        }}>{`创建 EKS 集群`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/docs/rancher2/cluster-provisioning/hosted-kubernetes-clusters/aks/_index"
        }}>{`创建 AKS 集群`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/docs/rancher2/cluster-provisioning/hosted-kubernetes-clusters/ack/_index"
        }}>{`创建 ACK 集群`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/docs/rancher2/cluster-provisioning/hosted-kubernetes-clusters/tke/_index"
        }}>{`创建 TKE 集群`}</a></li>
      <li parentName="ul"><a parentName="li" {...{
          "href": "/docs/rancher2/cluster-provisioning/hosted-kubernetes-clusters/cce/_index"
        }}>{`创建 CCE 集群`}</a></li>
    </ul>
    </MDXLayout>;
}

;
